import React from "react";
import NavigationBar from "../components/NavigationBar";
import Services from "../components/Services";
import Footer from "../components/Footer";

const ServicesPage = () => {
  return (
    <>
      <NavigationBar />
      <Services />
      <Footer />
    </>
  );
};

export default ServicesPage;
